description:
Killer Queen is a tribute album of Queen songs. The album is named for the 1974 Queen song of the same name that first appeared on the Sheer Heart Attack album.

The album peaked at #104 on the Billboard 200 on August 27, 2005. Later, it re-entered the Billboard 200 in April 2006 at #115 after American Idol (Season 5)&amp;#039;s Queen round.

